//2/ Spark
// load CSV from S3 bucket
val Lab2_loaddata = spark.read.option("header","true").csv("s3://lenovorecosys/rawdata/Quotation/Quotations-122718-ROW-DATA.csv")

//2/
//情境: 使用不同幣別的國家在產品的消費分布
// operation used: select, alias, cast
val select_column_toDouble = Lab2_loaddata.select($"Display Net Price Currency".alias("Currency"),$"Display Net Price".cast("int").alias("Net_Price")
,$"Display Quantity".cast("int").alias("Quantity"),$"PRODUCT ID".alias("Product_ID"))
select_column_toDouble.createOrReplaceTempView("select_column_toDouble")

//2/
// Spark transform on data
// function used: filter(contains, compare), groupBy, agg, sort, distinct
// function used: filter(contains, compare), groupBy, agg, sort, distinct
val transform_filter = select_column_toDouble.filter($"Product_ID".contains("MTM"))
val transofrm_groupBy = transform_filter.groupBy($"Product_ID").agg(sum("Quantity").alias("Sum_Quantity")).sort($"Sum_Quantity".desc)
transform_filter.filter("Sum(Quantity) > avg(Quantity)")
val action_count = transform_filter.select($"Currency").distinct()

//2/
// Spark action on data
// function used: show, count
action_count.show()
action_count.count()
